import React from 'react';
import Idea from './Idea';

const IdeaList = ({ideas, deleteIdea, editIdea}) => {

  return (
    <div>
      <div class="card">
    {/* <!-- Cover --> */}
    <div class="card__cover"></div>

    {/* <!-- Content --> */}
    <div class="card__content"></div>

</div>
      {ideas.map((idea) => {
        return(

        <Idea

          key={idea.id} 
          idea={idea} 
          deleteIdea={deleteIdea} 
          editIdea={editIdea}
          />

        );
      })}
    </div>
  );
};

export default IdeaList;
